import { useAuth } from "../contexts/AuthContext"
import Navbar from "./Navbar"

export default function Dashboard(props) {

    const {currentUser} = useAuth()

    return (
        <div>
            <Navbar />
            <div className="my-quizzes-title">My quizzes</div>
        </div>
    )
}
